INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("AB", "ユキ", "鏡で自分を見ること", "ヴァイスフリューゲル　ランドソル支部", "大空直美", 150, "ボクは誰よりも美しい", 40, 0, 10, 15, 14, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "エルフ", 100801, 10);
