INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("O", "マホ", "空想、ぬいぐるみ集め", "自警団（カォン）", "内田真礼", 155, "マホマホ王国のプリンセス", 42, 0, 9, 10, 16, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "獣人族", 101001, 22);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("A", "リノ", "お裁縫", "ラビリンス", "阿澄佳奈", 156, "人懐っこくてマシンガントークな妹系少女", 44, 0, 8, 3, 15, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ヒューマン", 101101, 25);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("A", "ハツネ", "妹と遊ぶこと、二度寝、昼寝、早寝", "フォレスティエ", "大橋彩香", 156, "みんなのために超能力を使う眠り姫", 46, 0, 12, 6, 17, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "エルフ", 101201, 24);
