INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "クルミ", "観劇、おままごと", "サレンディア救護院", "植田佳奈", 150, "泣き虫で臆病な守ってあげたい女の子", 40, 0, 6, 9, 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", 102101, 9);
