INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("AB", "タマキ（サマー）", "猫とたわむれること", "メルクリウス財団", "沼倉愛美", 158, "弱きを助け強きをくじく猫娘", 48, 0, 3, 12, 18, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", 107901, 1);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("O", "ミフユ（サマー）", "傭兵などのアルバイト", "メルクリウス財団", "田所あずさ", 163, "仕事も私事も効率優先な傭兵少女", 49, 0, 11, 12, 20, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", 108001, 11);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("AB", "シノブ（ハロウィン）", "占い", "悪魔偽王国軍（ディアボロス）", "大坪由佳", 157, "占いが得意な霊能少女", 42, 0, 12, 7, 18, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", 108101, 22);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "ミヤコ（ハロウィン）", "プリンを食べること", "悪魔偽王国軍（ディアボロス）", "雨宮天", 130, "プリン大好きゴースト娘", 32, 0, 1, 7, 14, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", 108201, 23);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("A", "ミサキ（ハロウィン）", "ファッション誌鑑賞、コスメ集め", "ルーセント学院", "久野美咲", 120, "ちょっとおませな恋に恋する女の子", 22, 0, 1, 14, 11, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "魔族", 108301, 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("O", "チカ（クリスマス）", "各種楽器", "カルミナ", "福原綾香", 163, "人々を守るために歌う、唱喚士の少女", 46, 0, 6, 4, 17, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 108401, 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "クルミ（クリスマス）", "観劇、おままごと", "サレンディア救護院", "植田佳奈", 150, "泣き虫で臆病な守ってあげたい女の子", 40, 0, 6, 9, 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", 108501, 9);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "アヤネ（クリスマス）", "屋内でできる遊び", "サレンディア救護院", "芹澤優", 148, "ぷうきちといつも一緒！", 38, 0, 5, 9, 14, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", 108601, 10);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("A", "ヒヨリ（ニューイヤー）", "人助け、応援", "トゥインクルウィッシュ", "東山奈央", 155, "人助けが大好き！　前向き格闘娘", 44, 0, 8, 2, 16, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", 108701, 27);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("O", "ユイ（ニューイヤー）", "料理、人間観察", "トゥインクルウィッシュ", "種田梨沙", 158, "戦闘のサポートが得意な、心優しい少女", 47, 0, 4, 2, 17, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", 108801, 5);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "レイ（ニューイヤー）", "読書、乗馬、お茶", "トゥインクルウィッシュ", "早見沙織", 163, "クールで何事にも真っ直ぐな剣士", 46, 0, 1, 2, 18, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", 108901, 12);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "エリコ（バレンタイン）", "実験、裁縫、料理", "トワイライトキャラバン", "橋本ちなみ", 154, "運命の相手に一途すぎる乙女", 43, 0, 7, 13, 16, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", 109001, 30);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("O", "シズル（バレンタイン）", "家事全般", "ラビリンス", "生天目仁美", 168, "お姉ちゃんがお世話してあげるからねっ！", 54, 0, 10, 3, 18, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", 109101, 24);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("AB", "アン", "読書", "？？？", "日笠陽子", 156, "英霊と契約を結んだマナリアの天才王女", 55, 0, 12, "", 17, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "ヒューマン", 109201, 1);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("O", "ルゥ", "食べること、眠ること", "？？？", "こやまきみこ", 144, "マナリア魔法学院の新入生", 45, 0, 2, "", 15, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ヒューマン", 109301, 4);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("B", "グレア", "ピアノ", "？？？", "福原綾香", 167, "人を超越した力を有す心優しい竜姫", 67, 0, 11, "", 17, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "半人半竜", 109401, 3);
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES ("AB", "クウカ（オーエド）", "小説を読むこと", "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 157, "妄想大好き！　ほんとは照れ屋な女の子", 49, 0, 11, 15, 18, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヒューマン", 109501, 19);
